import React from 'react';
import './styleNavMenu.css';


const MenuItem = (name, category) => (
    <div>
        <li className='item'>
            <h3 onClick={this.clickItemMenu(category)}>{name}</h3>
            {/* <a href={category} onClick={this.clickItemMenu(category)}>{name}</a> */}
        </li>
    </div> 
)

export default MenuItem;
